import React from 'react';
import './Home.css'
import useCourses from '../../hooks/useCourses'

const Home = () => {
    return (
        <div>
          <div className="banner">
            <h1 className="mt-5">This is where your fitness journey begins.</h1>
          </div>
          <div className="display-courses">
             const [courses] = useCourses();
          </div>
        </div>
    );
};

export default Home;
